지욱이가 새벽부터 열이 40도 넘게까지 올라가 아가도 고생, 나도 잠못자고 열체크하고 보살피느라 고생을했다. 아침에 해열제를 먹여도 38도가 넘어서 결국 병원에 갔다. 중국은 병원만 가면 피를 뽑는다. 그래도 의젓하게 진료도 채혈도 잘했다. 다행히 단순 감기였고 아루만에 열이 없어서 체온이 정상이 되었다. 지욱이 병원에 같이 가느라 반차를 낸 남편은 결국 오후 출근에 늦게 되어 다시 돌아왔고, 집에 오는 동안 왕돈가스를 만들어두었다. 저녁엔 축구하고 와서 김치볶음밥을 흡입을 하더라👍👍 항상 아플 때마다 칭얼거리지도 않고 잘 버텨주는 우리 지욱이 어제도 멍뭉이처럼 누워서 티비를 보고 잘 좀 쳐져있을 뿐 짜증도 내지 않았다. 그래서 더 안쓰러운 것 같다. 아가가 아프니 너무 무리해서 어린이집에 보냈나 뭘 잘못먹였나 별생각이 다 들었다. 하지만 다 과정이니 이 또한 지나가겠지 지욱이도 나도 성장하는 과정이라 생각하려 한다. 지욱아 우리 좀 더 힘내자 사랑해♥️
